import React from "react";
import Navbar from "./Navbar";
import Table, { AvatarCell, SelectColumnFilter, SocialBtn } from "./Table"; // new

const getData = () => {
  const data = [
    {
      id: 1,
      name: "Moh Alfaiz Ali",
      position: "Software Trainee",
      company: "Tata Consultancy Services",
      department: "Engineering",
      batch: 2023,
      branch: "CS/IT",
      ctc: 3.2,
      imgUrl:
        "https://pbs.twimg.com/profile_images/1534900086727409667/oYWJND3A_400x400.jpg",
      socials: "LinkedIn",
      socialUrl: "https://www.linkedin.com/in/imalfaiz/",
    },
    {
      id: 2,
      name: "Parag Malviya",
      position: "BDA",
      company: "BYJU'S",
      department: "Management",
      batch: 2021,
      branch: "Management",
      ctc: 10.0,
      imgUrl:
        "https://scontent.fbho4-1.fna.fbcdn.net/v/t1.6435-9/117895167_109440934209832_3095959929941710611_n.jpg?_nc_cat=106&ccb=1-7&_nc_sid=09cbfe&_nc_ohc=s0rrzoAoYPYAX_dAY_U&tn=O5hRLFyPxK1gK5rH&_nc_ht=scontent.fbho4-1.fna&oh=00_AT9jPrZdrUUG-3AR-7ackYx-Ps9mDSGxGn9X7FmkWXVcYg&oe=63707885",
      socials: "Facebook",
      socialUrl: "https://www.facebook.com/imalfaiz27/",
    },
    {
      id: 3,
      name: "Ankit Prajapati",
      position: "Agronomist",
      company: "BharatAgri",
      department: "Agriculture",
      batch: 2019,
      branch: "Agriculture",
      ctc: 6.0,
      imgUrl:
        "https://scontent.fbho4-1.fna.fbcdn.net/v/t39.30808-6/269609813_3218609035023043_1757897504544100496_n.jpg?_nc_cat=103&ccb=1-7&_nc_sid=09cbfe&_nc_ohc=AQZhUQ6JDsgAX-8H1gJ&_nc_ht=scontent.fbho4-1.fna&oh=00_AT8N-qzFr3T_wiv6VQbeHyWepnslVz9_NVBDL4XtN_C4Uw&oe=634E83BC",
      socials: "Instagram",
      socialUrl: "https://www.linkedin.com/in/imalfaiz/",
    },
    {
      id: 4,
      name: "Rahul Sharma",
      position: "Pharmacist",
      company: "Sun Pharma",
      department: "Pharmacy",
      batch: 2022,
      branch: "Pharmacy",
      ctc: 2.0,
      imgUrl:
        "https://scontent.fbho4-3.fna.fbcdn.net/v/t1.6435-9/200227959_107005931628272_8670577723938561369_n.jpg?_nc_cat=104&ccb=1-7&_nc_sid=09cbfe&_nc_ohc=RBcuCOQxuGYAX-kPiIs&_nc_ht=scontent.fbho4-3.fna&oh=00_AT-VMy_gXXMV4VJ2A6m-PIODZWcYq4VRPqKQX51F5lVEwg&oe=6371E28C",
      socials: "Twitter",
      socialUrl: "https://www.twitter.com/imalfaiz/",
    },
  ];
  return [...data, ...data, ...data];
};

function App() {
  const columns = React.useMemo(
    () => [
      {
        Header: "Name",
        accessor: "name",
        Cell: AvatarCell,
        imgAccessor: "imgUrl",
        positionAccessor: "position",
      },
      {
        Header: "Company",
        accessor: "company",
      },
      {
        Header: "Batch",
        accessor: "batch",
      },
      {
        Header: "CTC (in LPA)",
        accessor: "ctc",
      },
      {
        Header: "Branch",
        accessor: "branch",
        Filter: SelectColumnFilter, // new
        filter: "includes",
      },
      {
        Header: "Socials",
        accessor: "socials",
        Cell: SocialBtn,
        socialAccessor: "socialUrl",
      },
    ],
    []
  );

  const data = React.useMemo(() => getData(), []);

  return (
    <div className="min-h-screen bg-gray-100 text-gray-900">
      <main className="max-w-5xl mx-auto px-4 sm:px-6 lg:px-8 pt-4">
        <div className="">
          <Navbar />
        </div>
        <div className="mt-6">
          <Table className="table" columns={columns} data={data} />
        </div>
      </main>
    </div>
  );
}

export default App;
